import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';


const Discount = () => {
    return (
        <Container>
            <Row className='discount-backcolor my-3 mx-2 d-flex text-center align-items-center'>
                <Col sm="6"></Col>
            </Row>
        </Container>
    );
};

export default Discount;
